window.bookSummaryJSON = "<p>Eve Erixour is a mercenary with a past no one would envy and more enemies than anyone should have. Death stalks her relentlessly. So when she gains the attention of a League assassin, she considers it par for the course.</p> <p>But Jinx Shadowbourne isn't after Eve. Someone has it in for him and his brethren. High-ranking assassins are falling, and Jinx is convinced one of their own is selling them out. He's on the trail of his key suspect when fate throws him headfirst into Eve's life.</p> <p>Now the two of them have to find the League leak and plug it or neither one of them will live to face another enemy, and the ones they love, and the universe at large, will be left alone to face a power-crazed madman.</p> <p>Contains mature themes.</p>"; 
